import React, { useState } from "react";
import { useCompetencias } from '../../CompetenciasContext'; // Importa o hook useCompetencias
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

import { ContainerPage, TittlePage } from "../../components/Main";

const Nivelamento = () => {
    const { competencias } = useCompetencias();
  
    return (
      <div>
        <h2>Valores Adicionados:</h2>
        <ul>
          {competencias.map((competencia, index) => (
            <li key={index}>{competencia.valor}</li>
          ))}
        </ul>
        {/* Restante do seu c√≥digo da tela de Nivelamento */}
      </div>
    );
  };
  
  export default Nivelamento;
